<!doctype html>
<html lang="en">
<head>
<title>WA Map Maker</title>
</head>
<body>
<div>
<div style="text-align: center;">
<h1>Washington Map Builder</h1>

<div>
<label for="UpCSV">Import CSV</label>
<input accept=".csv" type="file" name="UpCSV" id="UpCSV" />
</div>
<div style="margin-top: 1em;">
<input type="button" value="Download" onkeypress="download()" onclick="download()" />
</div>
</div>

<div style="width: 90%; max-width: 1200px; margin: auto;">


<svg xmlns="http://www.w3.org/2000/svg" id="myMap" viewBox="0 0 2127.13 1352.35">

    <style>
	  foreignObject p {
		width: fit-content;
		background: white;
		margin: auto;
		padding: 3px;
		font-size: 30px;
	  }

      .noData {
		stroke: none;
		fill: lightgray;
      }

      .buffer {
        stroke-width: 15px;
		stroke: white;
		fill: none;
		stroke-linejoin: round;
      }
	  
      .border {
	  stroke-linejoin: round;
		fill: none;
        stroke: black;
        stroke-width: 2px;
      }

      .ptrn-2 {
        fill: none;
      }
	  .ptrn-line{
		fill: none;
		stroke: black;
		stroke-width: 1px;
	  }
	  .ptrn-fill{
		fill:black;
	  }

      .ptrn-3, .ptrn-4, .ptrn-2, .ptrn-5, .ptrn-6, .ptrn-7, .ptrn-8 {
        stroke-width: 0px;
      }


      .ptrn-Marsh, .ptrn-Marsh path, .ptrn-Marsh polygon {
        fill: url(#Marsh);
      }

      .ptrn-Circles, .ptrn-Circles path, .ptrn-Circles polygon {
        fill: url(#Circles);
      }

      .ptrn-Hatch, .ptrn-Hatch path, .ptrn-Hatch polygon {
        fill: url(#Hatch);
      }

      .ptrn-Plus, .ptrn-Plus path, .ptrn-Plus polygon {
        fill: url(#Plus);
      }

      .ptrn-Spots, .ptrn-Spots path, .ptrn-Spots polygon {
        fill: url(#Spots);
      }
      .ptrn-crsHatch, .ptrn-crsHatch path, .ptrn-crsHatch polygon {
        fill: url(#crsHatch);
      }
      .ptrn-8 {
        fill: #e1e31a;
      }

<script>
var myTextures = ["ptrn-Plus", "ptrn-Marsh", "ptrn-Hatch", "ptrn-Circles", "ptrn-Spots", "ptrn-crsHatch"]

document.getElementById('UpCSV').addEventListener('change', getCSV);
var Data
var rstates
var stateNames = []
var stateTotals = []
function readFileContent(file) {
	const reader = new FileReader();
	return new Promise((resolve, reject) => {
		reader.onload = event => resolve(event.target.result);
		reader.onerror = error => reject(error);
		reader.readAsText(file, "windows-1252");
	});
}


function getCSV(event) {
	const csvInput = event.target;
	if ('files' in csvInput && csvInput.files.length > 0) {
		console.log(csvInput.files[0]);
		readFileContent(csvInput.files[0]).then(content => {
		Data = $.csv.toArrays(content);
	console.log(Data);
	initFills()
	}).catch(error => console.log(error));
	}
	
}

function initFills(){
	rstates = getRowStates()
	console.log(rstates)
	for (b = 1; b < Data.length; b += 1){
		myState = getState(Data[b])
		if(rstates.includes(myState)){
		myClass = myTextures[rstates.indexOf(myState)];
		myName = Data[b][0].replace(" ", "_");
		thisCounty = document.getElementById(myName);
		thisCounty.setAttribute("class", myClass);
		myNum = getNum(Data[b]);
		if(myNum != 0){
			myTexts = thisCounty.getElementsByTagName("foreignObject")[0];
			myTexts.setAttribute("height", "120");
			newP = document.createElement("P");
			newP.innerHTML = myNum;
			newP.setAttribute("class", "numLabel")
			newP.setAttribute("xmlns", "http://www.w3.org/1999/xhtml")
			myTexts.appendChild(newP);
		}
	}}
	makeKey();
}

function getNum(row){
	myNum = 0;
	columnCount = 0;
	myLabel = "";
	for(n = 1; n < row.length; n += 1){
		if(row[n].length > 0){
			if(columnCount == 0){myNum = row[n]; columnCount += 1; myLabel = Data[0][n]}
			else{columnCount += 1;}
		}
	}
	if(columnCount < 2){return(myNum);}
	else{return(myLabel + ": " + myNum)}
}

function getState(row){
	myState = ""
	for(i = 1; i < row.length; i += 1){
		if(row[i] == 0 || row[i].length == 0){
				myState += "0";
			}
			else{myState += "1";
		}}
	return(myState)
}

function getRowStates() {
	stateNames = [];
	mystates = [];
	stateTotals = [];
	
	empty = ""
	for (i = 1; i < Data[1].length; i += 1){
		empty += "0"
	}
	for(row = 1; row < Data.length; row += 1){
		mySum = 0
		myState = getState(Data[row])
		for(c = 1; c < Data[row].length; c+= 1){
			mySum += Number(Data[row][c]);
		}
		if (!mystates.includes(myState) && myState != empty){mystates.push(myState); stateTotals.push(0);}
		
		if(mySum > 0){stateTotals[mystates.indexOf(myState)] += Number(mySum)}
	}
	console.log(mystates);
	for(s = 0; s < mystates.length; s += 1){
		myName = ""
		for(c = 0; c < mystates[s].length; c += 1){
			if (mystates[s][c] == "1"){
				if(myName.length > 0){ myName += ", ";}
				myName += Data[0][c + 1];
			}
		}
		stateNames.push(myName);
	}
	console.log(stateNames);
	console.log(stateTotals);
	return(mystates);
}
	
function makeKey(){
	// rstates, stateNames, stateTotals, myTextures
	buffer = 100;
	textBuffer = 25;
	tile = 250;
	var cols = Math.ceil(Math.sqrt(stateNames.length));
	var rows = Math.ceil(stateNames.length / cols);
	console.log(cols)
	console.log(rows)
	mySVG = document.getElementById("myKey");
	width = (cols * tile) + (buffer * 2);
	height =  (rows * tile) + (buffer * 2);
	mySVG.setAttribute("viewBox", "0 0 " + width + " " + height);
	var even = false; 
	var bufextra = (((cols * rows) - stateNames.length) * tile ) / 2;

	if (stateNames.length / cols == Math.round(stateNames.length / cols)){
		even = true;
	}

	var keyGroup = document.createElement("g");
	var keyBufferGroup = document.createElement("g");
	var keyBorderGroup = document.createElement("g");
	
	mySVG.appendChild(keyGroup);
	mySVG.appendChild(keyBufferGroup);
	mySVG.appendChild(keyBorderGroup);	

	for(k = 0; k < stateNames.length; k += 1){

		myRow 		= Math.ceil( (k + 1) / cols)
		myCol 		= (k + 1) - ((myRow - 1) * cols);
		newGroup 	= document.createElement("g");
		newTile 	= document.createElement("rect");
		newTileBuf 	= document.createElement("rect");
		newTileLin 	= document.createElement("rect");
		newLabel 	= document.createElement("foreignObject");
		labelP 		= document.createElement("p");
		totalP		= document.createElement("p");
		
		labelP.innerHTML =  stateNames[k];
		totalP.innerHTML =  stateTotals[k];
		labelP.setAttribute("xmlns", "http://www.w3.org/1999/xhtml")
		totalP.setAttribute("xmlns", "http://www.w3.org/1999/xhtml")
		
		if (myRow == rows && even == false){
			//this is the last row and it is incomplete
			newTile.setAttribute("x", buffer + bufextra + ((myCol - 1) * tile ) );
			newTileBuf.setAttribute("x", buffer + bufextra + ((myCol - 1) * tile ) );
			newTileLin.setAttribute("x", buffer + bufextra + ((myCol - 1) * tile ) );
			newLabel.setAttribute("x", buffer + bufextra + ((myCol - 1) * tile ) + textBuffer);
		}
		
		else {
			newTile.setAttribute("x", buffer + ((myCol - 1) * tile ) );
			newTileBuf.setAttribute("x", buffer + ((myCol - 1) * tile ) );
			newTileLin.setAttribute("x", buffer + ((myCol - 1) * tile ) );				
			newLabel.setAttribute("x", buffer + ((myCol - 1) * tile )  + textBuffer);
		}
		
		newTile.setAttribute("y", buffer + ((myRow - 1) * tile ) );
		newTile.setAttribute("width", tile );
		newTile.setAttribute("height", tile );
		newTile.setAttribute("class", myTextures[k]);
		
		newTileBuf.setAttribute("y", buffer + ((myRow - 1) * tile ) );
		newTileBuf.setAttribute("width", tile );
		newTileBuf.setAttribute("height", tile );
		newTileBuf.setAttribute("class", "buffer");
		
		newTileLin.setAttribute("y", buffer + ((myRow - 1) * tile ) );
		newTileLin.setAttribute("width", tile );
		newTileLin.setAttribute("height", tile );
		newTileLin.setAttribute("class", "border");
		
		newLabel.setAttribute("y", buffer + ((myRow - 1) * tile ) + textBuffer );
		newLabel.setAttribute("width", tile - (textBuffer * 2) );
		newLabel.setAttribute("height", tile - (textBuffer * 2) );
		
		keyGroup.appendChild(newGroup);
		newGroup.appendChild(newTile);
		keyBufferGroup.appendChild(newTileBuf);
		keyBorderGroup.appendChild(newTileLin);
		newGroup.appendChild(newLabel);
		newLabel.appendChild(labelP);
		newLabel.appendChild(totalP);

	}

	
	mySVG.innerHTML = mySVG.innerHTML ;
}

function download(){
	myvects = document.getElementsByTagName("svg");
	console.log(myvects);
	for (v in myvects){
		console.log(myvects[v])
		filename = "WaMapMaker." + myvects[v].getAttribute("id");
		var data = myvects[v].outerHTML;
		var file = new Blob([data], {
			type: "text"
		});
		if (window.navigator.msSaveOrOpenBlob) // IE10+
			window.navigator.msSaveOrOpenBlob(file, filename + ".svg");
		else { // Others
			var a = document.createElement("a"),
				url = URL.createObjectURL(file);
			a.href = url;
			a.download = filename + ".svg";
			document.body.appendChild(a);
			a.click();
			setTimeout(function() {
				document.body.removeChild(a);
				window.URL.revokeObjectURL(url);
			}, 0);
		}
	}
}
